import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { ShoppingCartPanel } from './Cart/ShoppingCartPanel';

export function MainRoutes() {
  return (
    <div>
        <Routes>
            <Route path="/" element={<ShoppingCartPanel />} />
        </Routes>
    </div>
  )
}
